import { UnicodeTrueTypeFont } from "../../../../../src/implementation/graphics/fonts/unicode-true-type-font";
import { PdfTrueTypeFont } from '../../../../../src/implementation/graphics/fonts/pdf-true-type-font';
import { PdfDocument, PdfGraphics, PdfPage, PdfColor, PdfSolidBrush } from '../../../../../src/index';
import { Utils } from '../../../utils.spec';

describe('UnicodeTrueTypeFont.ts', () => {
    describe('Constructor initializing',()=> {
        let fontFile1 : string = '';
        let fontFile2 : string = '';
        let t1 : PdfTrueTypeFont = new PdfTrueTypeFont(fontFile1, 10);
        it('constructor(undefined, 10)', () => {
            expect(function():void{new UnicodeTrueTypeFont(undefined, 10);}).toThrowError();
        })
        it('setSymbols(null)', () => {
            expect(function():void{t1.fontInternal.setSymbols(null);}).toThrowError();
        })
        t1.fontInternal.ttfReader.metrics.isFixedPitch = true;
        t1.fontInternal.ttfReader.metrics.macStyle = 3;
        t1.fontInternal.getDescriptorFlags();
        t1.fontInternal.getDescendantWidth();
        t1.fontInternal.descendantFontBeginSave();
        t1.fontInternal.fontDictionaryBeginSave();
        t1.fontInternal.cmapBeginSave();
        //t1.fontInternal.fontProgramBeginSave();
        let t2 : PdfTrueTypeFont = new PdfTrueTypeFont(fontFile1, 20);
        let t3 : PdfTrueTypeFont = new PdfTrueTypeFont(fontFile2, 20);
    })
})
describe('True Type Font',()=>{
    it('-Customer font', (done) => {
        let document : PdfDocument = new PdfDocument();
        //Add the Page 
		let page : PdfPage = document.pages.add();
		let graphics : PdfGraphics = page.graphics;
		let brush : PdfSolidBrush = new PdfSolidBrush(new PdfColor(100, 100, 100));
		let fontData : string = "";
		graphics.drawString("Chai    ", new PdfTrueTypeFont(fontData, 14), null, brush,10, 10, null);
		//Save the document
        document.save().then((xlBlob: { blobData: Blob }) => {
            if (Utils.isDownloadEnabled) {
                Utils.download(xlBlob.blobData, 'CustomerFont.pdf');
            }
            let reader: FileReader = new FileReader();
            reader.readAsArrayBuffer(xlBlob.blobData);
            reader.onload = (): void => {
                if (reader.readyState == 2) { // DONE == 2
                    expect((reader.result as ArrayBuffer).byteLength).toBeGreaterThanOrEqual(0);
                    done();
                }
                
            }
        });
        // destroy the document
        document.destroy();
    });
});